-- Of the Borrowers in the attached file, can you give me the LN80 rows where the Paid Ahead fields in LN80 are populated:
-- LD_NXT_PAY_DUE_AHD = 5/1/20 or any date after that
-- LA_NXT_TOT_DUE_AHD

DECLARE @SSNs TABLE (SSN varchar(9));


SELECT 
	LN80.*
FROM
	@SSNs SSN
	INNER JOIN UDW..LN80_LON_BIL_CRF LN80
		ON SSN.SSN = LN80.BF_SSN
WHERE
	LN80.LC_STA_LON80 = 'A' --active 
	AND LN80.LD_NXT_PAY_DUE_AHD >= '2020-05-01'
	AND ISNULL(LN80.LA_NXT_TOT_DUE_AHD,0.00) > 0.00